module.exports = "<h1>Agency Compliance</h1>\n<p>\n  The Source Code Policy requires agencies to perform specific one-time and recurring tasks in order to be considered compliant. Currently, agencies are being evaluated on whether they've completed two tasks:\n</p>\n<ol>\n  <li><b>Revised agency policy</b>: agencies must update their policies to be consistent with the Source Code Policy.</li>\n  <li><b>Code inventory</b>: agencies must publish an inventory of their source code in the prescribed format on their website.</li>\n</ol>\n\n<p>Agencies are rated as fully, partially, or non-compliant with these factors - green, yellow or red. An agency's overall compliance is green only if both of the factors are green.\n</p>\n<hr/>\n<div class=\"dashboard-container\">\n  <ul class=\"dashboard-list usa-unstyled-list\">\n    <li class=\"card dashboard-agency {{status.agency.overall}}\" *ngFor=\"let status of statuses\">\n      <div class=\"dashboard-agency-icon\">\n        <img src=\"assets/img/logos/agencies/{{status.agency.id}}.png\" alt=\"{{status.agency.name}}\"/>\n      </div>\n      <div class=\"dashboard-agency-content\">\n        <div class=\"dashboard-agency-heading\">\n          <h3>{{status.agency.name}}</h3>\n          <h4>\n            <span class=\"{{status.agency.overall}}\">\n              <span *ngIf=\"status.agency.overall=='compliant'\">Fully compliant</span>\n              <span *ngIf=\"status.agency.overall=='partial'\">Partially compliant</span>\n              <span *ngIf=\"status.agency.overall=='noncompliant'\">Non-compliant</span>\n            </span>\n          </h4>\n        </div>\n\n        <div class=\"dashboard-agency-requirements\" *ngFor=\"let requirement of status.requirements\">\n          <div *ngIf=\"requirement.text=='agencyWidePolicy'\">\n            <div class=\"requirement {{requirement.status}} \">\n                <span *ngIf=\"requirement.status=='compliant'\">Agency policy is consistent with the Source Code Policy</span>\n                <span *ngIf=\"requirement.status=='partial'\">Agency policy is being updated for consistency with the Source Code Policy.</span>\n                <span *ngIf=\"requirement.status=='noncompliant'\">Agency policy has not been reviewed for consistency with the Source Code Policy</span>\n            </div>\n          </div>\n          <div *ngIf=\"requirement.text=='schemaFormat'\">\n            <div class=\"requirement {{requirement.status}} \">\n                <span *ngIf=\"requirement.status=='compliant'\">\n                  Code inventory has been published.\n                </span>\n                <span *ngIf=\"requirement.status=='partial'\">Code inventory has been published but has technical errors.</span>\n                <span *ngIf=\"requirement.status=='noncompliant'\">Code inventory has not been published.</span>\n            </div>\n          </div>\n        </div>\n        <div class=\"dashboard-agency-link\" *ngIf=\"status.agency.codePath != null\">\n            <a toggle-menu routerLink=\"{{status.agency.codePath}}\" routerLinkActive=\"usa-current\">Explore the code</a>\n        </div>\n      </div>\n    </li>\n  </ul>\n</div>\n\n<p><i>Last updated: {{updated}}</i></p>\n"

