module.exports = "<h1>How OMB Will Assess Agency Progress</h1>\n<p>\n  <a pageScroll [routerLink]=\"['/policy-guide/policy/implementation']\" href=\"#accountability-mechanisms\">\n    Section 7.7\n  </a>\n  of the Federal Source Code Policy states that:\n</p>\n<blockquote>\n  <p>\n    Progress on agency implementation of this policy will be primarily assessed by OMB through an analysis of each agencys internal Government repositories, public OSS repositories, and code inventories on Code.gov, as well as data obtained through the quarterly Integrated Data Collection (IDC), quarterly PortfolioStat sessions, the IT Dashboard, and additional mechanisms [..]\n  </p>\n</blockquote>\n<p>\n  Generally, OMB's approach to assessing agency progress in meeting the Federal Source Code Policy's requirements can be broken into two categories:\n</p>\n<ol>\n  <li>\n    analysis of agencies' enterprise code inventories, individual code repositories, and open sourced code, with a\n  </li>\n  <li>\n    (2) comparison of that information against overall operational and financial data already collected by OMB.\n  </li>\n</ol>\n<p>OMB will provide additional information about its assessment mechanisms over time.</p>\n<h2>Analysis of Each Agencys Custom Code</h2>\n<p>\n  OMB will regularly review each agency&rsquo;s enterprise code inventory to ensure that the agency is satisfying the requirements of the Source Code Policy. This review will include both the agency&rsquo;s internal Government repositories and public open source repositories to ensure that each agency&rsquo;s enterprise code inventory is properly reflected on &ndash; and easily discoverable through &ndash; this website.\n</p>\n<h2>Analysis of Overall Data</h2>\n<p>\n  OMB collects agency data through a number of existing mechanisms, including quarterly PortfolioStat sessions and the Integrated Data Collection. Much of this data is publicly available on <a href=\"https://itdashboard.gov\">ITDashboard.gov</a>. OMB will use this data and other relevant information to better understand the overall impact of the Source Code Policy over time.\n</p>\n"

