module.exports = "<h2>6. Exceptions to Government Code Reuse</h2>\n\n<p>The exceptions provided below may be applied, in specific instances, to exempt an agency from sharing custom-developed code with other Government agencies. These exceptions do not apply to the OSS pilot program.<sup id=\"fnr31\"><a pageScroll href=\"#fn31\">31</a></sup> Any exceptions used must be approved and documented by the agencys CIO for the purposes of ensuring effective oversight and management of information technology resources.</p>\n\n<p>Applicable exceptions are as follows:</p>\n\n<ol>\n  <li>The sharing of the source code is restricted by law or regulation, includingbut not limited topatent or intellectual property law, the Export Asset Regulations, the International Traffic in Arms Regulation, and the Federal laws and regulations governing classified information;</li>\n  <li>The sharing of the source code would create an identifiable risk to the detriment of national security, confidentiality of Government information, or individual privacy;</li>\n  <li>The sharing of the source code would create an identifiable risk to the stability, security, or integrity of the agencys systems or personnel;</li>\n  <li>The sharing of the source code would create an identifiable risk to agency mission, programs, or operations; or</li>\n  <li>The CIO believes it is in the national interest to exempt sharing the source code.</li>\n</ol>\n\n<p>For excepted software, agencies must provide OMB a brief narrative justification for each exception, with redactions as appropriate.</p>\n\n<br />\n<h4 id=\"footnotes\">Footnotes</h4>\n<ul class=\"list-unstyled\">\n  <li id=\"fn31\"><sup>31</sup> <em>See</em> Section 5 for additional information regarding the pilot program. <a pageScroll href=\"#fnr31\">&#8617;</a></li>\n</ul>\n"

